import{_ as e,c as a,o as t,a2 as l}from"./chunks/framework.Ja7AKUN6.js";const P=JSON.parse('{"title":"代码提交流程及注意事项","description":"","frontmatter":{"sidebar_position":4,"title":"代码提交流程及注意事项","date":"2025-05-02T00:00:00.000Z","updated":"2025-05-02T00:00:00.000Z","categories":"项目公告","tags":["开发"]},"headers":[],"relativePath":"wiki/code.md","filePath":"wiki/code.md"}'),i={name:"wiki/code.md"},o=l('<h1 id="代码提交流程及注意事项" tabindex="-1">代码提交流程及注意事项 <a class="header-anchor" href="#代码提交流程及注意事项" aria-label="Permalink to &quot;代码提交流程及注意事项&quot;">​</a></h1><h2 id="提交流程说明" tabindex="-1">提交流程说明 <a class="header-anchor" href="#提交流程说明" aria-label="Permalink to &quot;提交流程说明&quot;">​</a></h2><h3 id="代码提交流程" tabindex="-1">代码提交流程： <a class="header-anchor" href="#代码提交流程" aria-label="Permalink to &quot;代码提交流程：&quot;">​</a></h3><ol><li>创建新分支并编写代码。</li><li>在提交 Pull Request 时，若尚未完成工作，需在标题前加上<code>WIP</code>（Work In Progress）标识，避免不小心合并。</li><li>在 Pull Request 中提供详尽的描述；如果涉及重大改动，请事先与项目的主要维护者沟通。</li><li>除非是主要维护者的 Pull Request，否则在合并前需要至少一名测试人员/主要维护者审核通过（并且要通过全部自动化测试），方可合并到主分支。</li></ol><p>注：测试时特别关注能否成功构建，特别是 prebuild 这样的任务，失败可能会使得 build 无法进行。</p><p><strong>除紧急的线上漏洞修改以外，任何代码都需经以上流程，并合并到主分支后，方可进入线上环境测试！</strong></p><h3 id="文档提交流程" tabindex="-1">文档提交流程： <a class="header-anchor" href="#文档提交流程" aria-label="Permalink to &quot;文档提交流程：&quot;">​</a></h3><ol><li>创建新分支并编写文档。</li><li>在提交 Pull Request 时，若尚未完成工作，需在标题前加上<code>WIP</code>（Work In Progress）标识，避免不小心合并。</li><li>在 Pull Request 中提供详尽的描述；如涉及重大改动，请与主要维护者事先沟通。</li><li>除非是主要维护者的 Pull Request，否则在合并前需要至少一名对应项目的文档维护者审核通过（并且要通过全部自动化测试），方可合并到主分支。</li><li>提交后，请及时通知翻译组成员。</li></ol>',8),r=[o];function s(d,c,n,u,_,h){return t(),a("div",null,r)}const q=e(i,[["render",s]]);export{P as __pageData,q as default};
